Here is the step-by-step guide to create a React,Node.js, and Express.js web app:

**Step 1: Create a new React app**

Open your terminal and run the following command to create a new React app:
```
npx create-react-app my-app
```
This will create a new React app in a directory called `my-app`.

**Step 2: Create a new Node.js and Express.js server**

In the same terminal, navigate to the `my-app` directory and run the following command to create a new Node.js and Express.js server:
```
npm init -y
npm install express
```
This will create a new `package.json` file and install Express.js.

**Step 3: Create a new file for the server**

Create a new file called `server.js` in the root of the `my-app` directory:
```
touch server.js
```
**Step 4: Add code to the server file**

Add the following code to the `server.js` file:
```
const express = require('express');
const app = express();
const port = 3001;

app.use(express.json());

app.get('/api/data', (req, res) => {
  const data = [
    { id: 1, name: 'John Doe', age: 30 },
    { id: 2, name: 'Jane Doe', age: 25 },
    { id: 3, name: 'Bob Smith', age: 40 },
  ];
  res.json(data);
});

app.listen(port, () => {
  console.log(`Server started on port ${port}`);
});
```
This code creates an Express.js server that listens on port 3001 and responds to GET requests to the `/api/data` endpoint with some dummy data.

**Step 5: Create a new file for the React app**

Create a new file called `App.js` in the `src` directory:
```
touch src/App.js
```
**Step 6: Add code to the React app file**

Add the following code to the `App.js` file:
```
import React, { useState, useEffect } from 'react';
import axios from 'axios';

function App() {
  const [data, setData] = useState([]);

  useEffect(() => {
    axios.get('http://localhost:3001/api/data')
      .then(response => {
        setData(response.data);
      })
      .catch(error => {
        console.error(error);
      });
  }, []);

  return (
    <div>
      <h1>Data</h1>
      <ul>
        {data.map(item => (
          <li key={item.id}>
            {item.name} ({item.age})
          </li>
        ))}
      </ul>
    </div>
  );
}

export default App;
```
This code creates a React app that fetches data from the Express.js server and displays it in a list.

**Step 7: Start the server and the React app**

Start the server by running the following command in the terminal:
```
node server.js
```
Start the React app by running the following command in the terminal:
```
npm start
```
Open your web browser and navigate to `http://localhost:3000` to see the React app in action.

